INSERT INTO `consult_class` VALUES (1,'商品咨询',1,'<p><strong>商城承诺：</strong>商品均为原装正品行货，自带机打发票，严格执行国家三包政策，享受全国联保服务。<br/> <strong>功能咨询：</strong>咨询商品功能建议您拨打各品牌的官方客服电话，以便获得更准确的信息。</p>','2025-08-06 21:58:50',NULL,'2025-08-06 21:58:50',NULL,0),(2,'支付问题',2,'<p><strong>大额支付</strong>：线上支付中的招行、工行、建行、农行、广发支持大额支付，最高单笔一次支付10000元。<br/> <strong>货到付款</strong>：只有官方店铺支持货到付款功能。</p>','2025-08-06 21:58:50',NULL,'2025-08-06 21:58:50',NULL,0),(3,'发票及保修',3,'<p><strong>商城承诺</strong>：商品均为原装正品行货，自带机打发票，严格执行国家三包政策，享受全国联保服务。<br/> <strong>发票类型</strong>：商城所售商品均自带机打发票，在提供相关企业资料证明后，可申请开取增值税发票。<br/> <strong>退 换 货</strong>：商城为您提供完善的退换货服务。<br/></p>','2025-08-06 21:58:50',NULL,'2025-08-06 21:58:50',NULL,0),(4,'促销及赠品',4,'<p>促销及赠品<br/></p>','2025-08-06 21:58:50',NULL,'2025-08-06 21:58:50',NULL,0),(5,'投诉问题',5,'<p> 1、未履行正品保障服务承诺的，消费者可通过保真商城购客服渠道（客户服务-在线咨询）进行投诉。   \n   2、消费者投诉商品非“正品”的，应向保真商城提供有效凭证，该凭证包括但不限于具备相关检测资质的质检机构出具的材质鉴定报告、品牌方出具的假冒（包括盗版）品牌鉴定报告等。\n            </p>','2025-08-06 21:58:50',NULL,'2025-08-06 21:58:50',NULL,0);
